// src/parsers/worldFamousParser.js
import * as pdfjsLib from "pdfjs-dist/build/pdf";
import pdfWorker from "pdfjs-dist/build/pdf.worker.entry";

// Ensure worker is properly configured
pdfjsLib.GlobalWorkerOptions.workerSrc = pdfWorker;

/**
 * parsePDFWorldFamous(arrayBuffer)
 *  For World Famous / Ink Projects invoices
 */
export const parsePDFWorldFamous = async (buffer) => {
  try {
    const pdf = await pdfjsLib.getDocument({ data: buffer }).promise;
    const page = await pdf.getPage(1);
    const textContent = await page.getTextContent();
    const items = [];

    // Combine all text items into a single string with proper spacing
    const fullText = textContent.items.map(item => {
      const str = item.str;
      // Add space between items if they're not already separated
      const prevItem = textContent.items[textContent.items.indexOf(item) - 1];
      if (prevItem && !prevItem.str.endsWith(' ') && !str.startsWith(' ')) {
        return ' ' + str;
      }
      return str;
    }).join('');

    // Split the text into lines and clean them up
    const lines = fullText.split('\n').map(line => line.trim()).filter(line => line.length > 0);

    // Process each line looking for World Famous items
    for (let i = 0; i < lines.length; i++) {
      const line = lines[i].trim();

      // Skip empty lines or lines that don't contain item information
      if (!line || line.includes('Page') || line.includes('Total') || line.includes('Subtotal')) {
        continue;
      }

      // Extract item code (usually starts with WF)
      const itemCodeMatch = line.match(/(WF[A-Z0-9]+)/);
      if (!itemCodeMatch) {
        continue;
      }

      const itemCode = itemCodeMatch[1];

      // Extract quantity (look for numbers in the line)
      const quantityMatch = line.match(/(\d+)\s*$/);
      const quantity = quantityMatch ? parseInt(quantityMatch[1]) : 0;

      // Extract color (text between item code and quantity)
      let color = line
        .replace(itemCode, '')
        .replace(quantityMatch ? quantityMatch[0] : '', '')
        .trim();

      // Clean up color name
      color = processColorName(color);

      // Determine size based on item code or color
      let size = '';
      if (color.includes('1/2oz')) {
        size = '0.5oz';
      } else if (color.includes('1oz')) {
        size = '1oz';
      } else if (color.includes('2oz')) {
        size = '2oz';
      } else if (color.includes('4oz')) {
        size = '4oz';
      } else if (color.includes('6oz')) {
        size = '6oz';
      } else if (color.includes('12oz')) {
        size = '12oz';
      } else {
        // Default to 1oz if no size is specified
        size = '1oz';
      }

      // Remove size from color name
      color = color.replace(/[\d/]+oz/g, '').trim();

      // If color is empty, try to get it from the item code
      if (!color) {
        color = getColorFromItemCode(itemCode);
      }

      // Skip if we don't have a valid item
      if (!itemCode || !color) {
        continue;
      }

      items.push({
        itemCode,
        color,
        size,
        quantity: quantity || 1 // Default to 1 if no quantity found
      });
    }

    if (items.length === 0) {
      throw new Error('No valid items found in the invoice');
    }

    return items;
  } catch (error) {
    console.error('Error parsing World Famous PDF:', error);
    throw new Error('Failed to parse World Famous invoice: ' + error.message);
  }
};

function processColorName(colorText) {
  // Remove any page header/footer information
  let color = colorText
    .replace(/\s+\d+\s+of\s+\d+(?:\s+Sales\s+Order.*)?$/gm, '')
    .replace(/\s+Sales\s+Order.*$/gm, '')
    .replace(/\s+Qty\s+(?:Fulfilled|Invoiced).*$/gm, '')
    .replace(/\s+\d+\/\d+\/\d+.*$/gm, '')
    .replace(/Kuro\s+Sumi\s+Tattoo\s+Ink.*$/gm, '')
    .replace(/— World Famous(?:\s+Tattoo\s+)?(?:Ink)?(?:\s+—)?/gi, '')
    .replace(/World Famous(?:\s+Tattoo)?(?:\s+—)?/gi, '')
    .replace(/Tattoo Ink(?:\s+—)?/gi, '')
    .replace(/\s*—\s*$/g, '')
    .replace(/\s*—\s*/g, ' ')
    .replace(/\s+/g, ' ')
    .replace(/\s*\([^)]*\)/g, '')
    .replace(/\s*\[[^\]]*\]/g, '')
    .replace(/\s*\{[^}]*\}/g, '')
    .replace(/\s*\$[\d.,]+/g, '')
    .trim();

  // Special case handling for specific product lines
  if (color.includes('NBK')) {
    color = color.replace(/Dima\s+NBK\s+/, 'Dima NBK ');
  }
  if (color.includes('Jay Freestyle')) {
    color = color.replace(/Jay\s+Freestyle\s+/, 'Jay Freestyle ');
  }
  if (color.includes('Sarah Miller')) {
    color = color.replace(/Sarah\s+Miller\s+/, 'Sarah Miller ');
  }
  if (color.includes('Ryan Smith')) {
    color = color.replace(/Ryan\s+Smith\s+/, 'Ryan Smith ');
  }

  return color;
}

function getColorFromItemCode(itemCode) {
  // Special cases for specific product lines
  if (itemCode.startsWith('WFADPP')) {
    const num = itemCode.match(/\d+/)?.[0]?.[0] || '';
    return `Pancho Pastel #${num}`;
  }

  if (itemCode.startsWith('WFP2H')) {
    return 'Poch 2H';
  }

  if (itemCode.startsWith('WFMHS')) {
    return 'Must-Haves';
  }

  if (itemCode.startsWith('WFILL')) {
    return 'Illuminati Yellow';
  }

  // Extract color name from item code if no color was found
  const parts = itemCode.split(/[0-9]/)[0].split('WF');
  if (parts.length > 1) {
    return parts[1].split('').map(char => {
      if (char === char.toUpperCase()) {
        return ' ' + char;
      }
      return char;
    }).join('').trim();
  }
  return itemCode;
}

const parseItem = (itemText) => {
  const lines = itemText.split('\n');
  const itemCodeMatch = lines[0].match(/Item Code:\s*([^\s]+)/);
  const colorMatch = lines[0].match(/Color:\s*([^\n]+)/);
  const sizeMatch = lines[0].match(/Size:\s*([^\n]+)/);
  const quantityMatch = lines[0].match(/Quantity:\s*(\d+)/);

  if (!itemCodeMatch || !colorMatch || !sizeMatch || !quantityMatch) {
    return null;
  }

  return {
    itemCode: itemCodeMatch[1].trim(),
    color: colorMatch[1].trim(),
    size: sizeMatch[1].trim(),
    quantity: parseInt(quantityMatch[1]),
  };
};
